import React from 'react';
import ReactDOM from 'react-dom';

class Hello extends React.Component {
    render() {
        return React.createElement('div', null, `Look Ma No ${this.props.towhat}`);
    }
}

ReactDOM.render(
    React.createElement(Hello, { toWhat: 'JSX' }, null),
    document.getElementById('root')
);
